import React from 'react';


function Card(props) {
  const { id, name, email } = props.robots;
  return (
    <div className="card">
  	  <img src={`https://robohash.org/${id}?150x150`} />
  	  <p>{name}</p>
  	  <p>{email}</p>        
    </div>
  );
}

export default Card;
